    left:-20,
    
  },
  proton2:{
    position: 'absolute',
    zIndex: 6,
    bottom: -20,
    right:-20
  },
  proton1:{
    position: 'absolute',
    zIndex: 5,
    top: -20,
    left:-20
  },
  neutron1:{ 
    position: 'absolute',
    zIndex: 4,
    top: -20,
    right:-20
  },
  
  outerBorderContainer: {
    width: 550,
    height: 550,
    borderRadius: 550,
    borderWidth: 3,
    borderColor: 'white',
    position: 'relative',
  },
  outerCircle: {
    width: 50,
    height: 50,
    borderRadius: 50,
    backgroundColor: 'green',
    position: 'absolute',
    top: 0,
    left: 130,
  },
  secondBorderContainer: {
    width: 450,
    height: 450,
    borderRadius: 450,
    borderWidth: 3,
    borderColor: 'white',
    position: 'relative',
    zIndex: 99,
  },
  secondCircle: {
    width: 50,
    height: 50,
    borderRadius: 50,
    backgroundColor: 'green',
    position: 'absolute',
