    borderWidth: 3,
    borderColor: 'white',
    position: 'relative',
  },
  thirdCircle: {
    width: 50,
    height: 50,
    borderRadius: 50,
    backgroundColor: 'green',
    position: 'absolute',
    top: 170,
    left: -20,
  },
  
});

export default CircleAnimation;
